import React from 'react';
import { Smartmobile } from "./styles/Login";
import { StatusBar, Logo } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';

const Login = () => {
    return (
        <Logo>
        <Smartmobile> SmartMobile </Smartmobile>
      </Logo>
    );
  }
  
  export default Login;
